import React from 'react'


function Sidebar({ topAnime }) {
	return (
		<aside className="sidebar">
			<nav>
				<h3>Top Anime</h3>
				{topAnime.map(anime => (
					<a
						href={anime.url}
						target="_blank"
						key={anime.mal_id}
						rel="noreferrer">
						{anime.title}
					</a>
				))}
			</nav>
		</aside>
	)
}

export default Sidebar
